  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: 'FAQ'
};
export const metadata = {
  "unversionedId": "FAQ",
  "id": "FAQ",
  "isDocsHomePage": false,
  "title": "FAQ",
  "description": "What are NFTs?",
  "source": "@site/docs/FAQ.md",
  "slug": "/FAQ",
  "permalink": "/FAQ",
  "editUrl": "https://github.com/IDEP-network/IDEP-Docs/docs/FAQ.md",
