  "sidebar": "docs",
  "previous": {
    "title": "Modules",
    "permalink": "/Modules"
  },
  "next": {
    "title": "Public Roadmap",
    "permalink": "/Roadmap"
  }
};
  /* @jsxRuntime classic */
/* @jsx mdx */

export const toc = [{
  value: 'What are NFTs?',
  id: 'what-are-nfts',
  children: []
}, {
  value: 'Where can I buy IDEP tokens?',
  id: 'where-can-i-buy-idep-tokens',
  children: []
}, {
  value: 'Will there be an ICO?',
  id: 'will-there-be-an-ico',
  children: []
}, {
  value: 'How can I become a validator?',
  id: 'how-can-i-become-a-validator',
  children: []
}, {
  value: 'Is IDEP open-sourced?',
  id: 'is-idep-open-sourced',
  children: []
}];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h3 {...{
      "id": "what-are-nfts"
    }}>{`What are NFTs?`}</h3>
    <p>{`Non-fungible tokens (NFT) are digital assets that represent a wide range of unique tangible and intangible goods, from digital art
to music videos and even in-game assets.`}</p>
    <h3 {...{
      "id": "where-can-i-buy-idep-tokens"
    }}>{`Where can I buy IDEP tokens?`}</h3>
    <ul>
      <li parentName="ul">{`There are no `}<strong parentName="li">{`IDEP`}</strong>{` tokens for sale at this time. If you have been contacted by anyone regarding the purchase of `}<strong parentName="li">{`IDEP`}</strong>{` tokens
please be aware it's a scam.`}</li>
      <li parentName="ul">{`There is no plan for an airdrop. `}</li>
    </ul>
    <h3 {...{
      "id": "will-there-be-an-ico"
    }}>{`Will there be an ICO?`}</h3>
    <p>{`No, IDEP Network will not be having an ICO, Instead we will be having a Utility Token Distribution Event (`}<strong parentName="p">{`UTDE`}</strong>{`) open to specific
regions only. More information on this will be revealed soon. `}</p>
    <h3 {...{
      "id": "how-can-i-become-a-validator"
    }}>{`How can I become a validator?`}</h3>
    <p>{`IDEP Network is currently in alpha devnet phase, we are actively looking for experienced validators to join us in the upcoming
public test-net and eventual mainnet. Contact us at `}<a parentName="p" {...{
        "href": "mailto:hello@idep.network"
      }}>{`hello@idep.network`}</a>{` for more information. `}</p>
    <h3 {...{
      "id": "is-idep-open-sourced"
    }}>{`Is IDEP open-sourced?`}</h3>
    <p>{`IDEP plans to open source its entire codebase after the Utility Token Distribution Event.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
